import React, { useEffect } from "react";
import { useSelector } from "react-redux";

const Index = () => {
  const { isAuth } = useSelector((state) => state.auth);

  useEffect(() => {
    if (!isAuth) {
      // send to login page
    }
  }, []);

  return <div>Index</div>;
};

export default Index;
